import ExpenseItem from './components/ExpenseItem';
import Expenses from './components/Expenses'

function App() {
  const expenses = [
    { title: 'Car Insurance', amount: 294.62, date: new Date(2021, 4, 2), currency: "$" },
    { title: 'Big Bazaar', amount: 76, date: new Date(2017, 2, 2), currency: "$" },
    { title: 'Recharge', amount: 209, date: new Date(2019, 1, 12), currency: "$" },
    { title: 'Boxing class', amount: 145, date: new Date(2018, 4, 2), currency: "$" }
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <Expenses expenses={expenses}></Expenses>
      <ExpenseItem title={expenses[0].title} amount={expenses[0].amount} date={expenses[0].date} curr={expenses[0].currency}></ExpenseItem>
      <ExpenseItem title={expenses[1].title} amount={expenses[1].amount} date={expenses[1].date} curr={expenses[1].currency}></ExpenseItem>
      <ExpenseItem title={expenses[2].title} amount={expenses[2].amount} date={expenses[2].date} curr={expenses[2].currency}></ExpenseItem>
      <ExpenseItem title={expenses[3].title} amount={expenses[3].amount} date={expenses[3].date} curr={expenses[3].currency}></ExpenseItem>
    </div>
  );
}

export default App;
